import logo from "./logo.svg";
import "./App.css";
import { Header } from "./features/header/Header";

import { ToDoBoard } from "./features/todoList/ToDoBoard";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Header />

        <ToDoBoard />
      </header>
    </div>
  );
}
export default App;
